import "core-js/modules/es6.promise";
import Vue from 'vue';
import App from './App.vue';
import VueRouter from 'vue-router';
Vue.use(VueRouter);
import store from './store';
import backtester from './components/backtester/backtester.vue';
import home from './components/layout/home.vue';
import data from './components/data/data.vue';
import importer from './components/data/import/importer.vue';
import singleImport from './components/data/import/single.vue';
import config from './components/config/config.vue';
import gekkoList from './components/gekko/list.vue';
import newGekko from './components/gekko/new.vue';
import singleGekko from './components/gekko/singleGekko.vue';
import { connect as connectWS } from './components/global/ws';
import bishijie from "./components/bishijie/bishijie.vue";
var router = new VueRouter({
  mode: 'hash',
  base: __dirname,
  routes: [{
    path: '/',
    redirect: '/home'
  }, {
    path: '/home',
    component: home
  }, {
    path: '/backtest',
    component: backtester
  }, {
    path: '/config',
    component: config
  }, {
    path: '/data',
    component: data
  }, {
    path: '/data/importer',
    component: importer
  }, {
    path: '/data/importer/import/:id',
    component: singleImport
  }, {
    path: '/live-gekkos',
    component: gekkoList
  }, {
    path: '/live-gekkos/new',
    component: newGekko
  }, {
    path: '/live-gekkos/:id',
    component: singleGekko
  }, {
    path: "/bishijie",
    component: bishijie
  }]
}); // setup some stuff

connectWS();
new Vue({
  router: router,
  store: store,
  el: '#app',
  render: function render(h) {
    return h(App);
  }
});
